import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import CoLab from './Components/CoLab'; // Adjust the import path according to your project structure
import './App.css'; // Assuming you have some general styles for your app
import About from './Components/Pages/About';
import Footer from './Components/Footer';
import useScrollToTop from './Components/useScrollToTop'; // Adjust the path as needed

function App() {
  useScrollToTop();
  return (
    <Router>
      <ScrollToTop>
      <div className="App">
        <Routes>
          <Route path="/" element={<CoLab />}/>
          <Route path="/about" element={<About />}/>
          {/* Add more Route components here for other pages */}
        </Routes>
        <Footer />
      </div>
      </ScrollToTop>
    </Router>
  );
}
const ScrollToTop = ({ children }) => {
  useScrollToTop();
  return children;
};

export default App;
